var levels = [];

// Appends all custom levels to the levels list
function loadCustomLevels() {
  levels = _levels.slice();

  var numLevels = _levels.length;
  var customLevels = levelsList.get('levels', []);
  var numCustomLevels = customLevels.length;
  for (var i = 0; i < numCustomLevels; i++) {
    levels[numLevels + i] = {
      custom: true,
      index: i,
      label: customLevels[i].label,
      grid: customLevels[i].grid
    };
  }
}

function saveCustomLevel(label, grid, index) {
  var customLevels = levelsList.get('levels', []);
  if (index === undefined) {
    index = customLevels.length;
  }

  customLevels[index] = {
    label: label,
    grid: grid
  };

  levelsList.set('levels', customLevels);

  return index;
}

function deleteCustomLevel(index) {
  if (!levels[index] || !levels[index].custom) {
    return;
  }

  var customLevels = levelsList.get('levels', []);
  customLevels.splice(levels[index].index, 1);
  levelsList.set('levels', customLevels);
}

function makeChallengeCode(index) {
  if (!levels[index]) {
    return;
  }

  var data = {};
  var level = levels[index];

  if (level.custom) {
    // also add track data
    data.level = clone(level);
  }
  else {
    data.index = index;
  }

  var challengeCode = LZString.compressToEncodedURIComponent(JSON.stringify(data));
  //var data = JSON.parse(LZString.decompressFromEncodedURIComponent(challengeCode));

  var label = level.label;
  if (challengeCode) {
    prompt('Copy this code and challenge someone to beat your best time for level "' + label + '".', challengeCode);
  }
  else {
    alert('Could not create a challenge code.');
  }
}

